/**
 * Utility class exposing commonly used SDK constants.
 */
export default class Constants {
    /** MindsDB Cloud endpoint. */
    static readonly BASE_CLOUD_API_ENDPOINT = "https://cloud.mindsdb.com";
    /** MindsDB Cloud login endpoint. */
    static readonly BASE_LOGIN_URI = "/cloud/login";
    /** MindsDB managed login endpoint. */
    static readonly BASE_MANAGED_LOGIN_URI = "/api/login";
    /** MindsDB SQL query endpoint. */
    static readonly BASE_SQL_URI = "/api/sql/query";
    /** MindsDB Projects endpoint. */
    static readonly BASE_PROJECTS_URI = "/api/projects";
    /** How long to wait for an HTTP response before timeout. */
    static readonly DEFAULT_HTTP_TIMEOUT_MS: number;
    /** Maximum number of socket connections per host. */
    static readonly DEFAULT_MAX_SOCKETS_PER_HOST = 128;
    /** Maximum number of sockets per host to leave open in a free state. */
    static readonly DEFAULT_MAX_FREE_SOCKETS = 128;
    /** Timeout active sockets after this period of inactivity. */
    static readonly DEFAULT_ACTIVE_SOCKET_TIMEOUT_MS: number;
    /** Timeout free sockets after this period of inactivity. */
    static readonly DEFAULT_FREE_SOCKET_TIMEOUT_MS: number;
}
